// src/components/Navbar.js
import React from 'react';
import { AppBar, Toolbar, Typography, Button, IconButton, Grid } from '@mui/material';
import { makeStyles } from '@mui/styles';
import MenuIcon from '@mui/icons-material/Menu';
import { Link } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: 'transparent',
    boxShadow: 'none',
  },
  brand: {
    flexGrow: 1,
    textDecoration: 'none',
    color: '#FFF',
    fontSize: '1.5rem', // Adjust font size as needed
  },
  button: {
    color: '#FFF',
    fontSize: '1rem', // Adjust font size as needed
  },
}));

const Navbar = () => {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar>
        <Grid container alignItems="center">
          <Grid item xs={6} md={3}>
            <Typography variant="h6" component={Link} to="/" className={classes.brand}>
              Tender App
            </Typography>
          </Grid>
          <Grid item xs={6} md={9}>
            <Grid container justifyContent="flex-end" alignItems="center">
              <Button component={Link} to="/login" className={classes.button}>
                Login
              </Button>
              <IconButton edge="end" color="inherit" aria-label="menu">
                <MenuIcon />
              </IconButton>
              {/* Add more buttons or menu items as needed */}
            </Grid>
          </Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
